import React, { useState } from "react";

const Homepage = (props) => {
    const [toggle, setToggle] = useState(true);

    setInterval(() => {
        console.log(toggle)
        if(toggle) return setToggle(false)
        return setToggle(true); 
    }, (1000))
}

export default Homepage;
